import sys
line = ''

f1 = open("file_1.txt", 'w')
f2 = open("file_2.txt", 'w')
f3 = open("file_3.txt", 'w')
f4 = open("file_4.txt", 'w')
f5 = open("file_5.txt", 'w')


for elem in range(0,len(line),5):
    if elem == 0:
        f1.write(line[elem])
        f2.write(line[elem+1])
        f3.write(line[elem+2])
        f4.write(line[elem+3])
        f5.write(line[elem+4])
    if elem>0 and elem<len(line)-5:
        f1.write(line[elem])
        f2.write(line[elem+1])
        f3.write(line[elem+2])
        f4.write(line[elem+3])
        f5.write(line[elem+4])
    if elem == len(line)-5:
        f1.write(line[elem])
        f2.write(line[elem+1])
        f3.write(line[elem+2])
        f4.write(line[elem+3])
        f5.write(line[elem+4])